import styled from 'styled-components';

export const ProfileContainer = styled.section`
  width: 1536px;
  box-sizing: border-box;
`;

export const ProfileHeader = styled.div`
  width: 1453px;
  margin: 0 auto;

  .profile-header {
    display: flex;
    &__left {
      background: red;

      &__user {
        display: flex !important ;
      }
    }
  }
`;
